import { useEffect, useState } from "react";
import { allMoney } from "../../share/Money";
import style from "./Body.module.css"
function Body() {
  const [moneyList, setMoney] = useState([]);
  useEffect(() => {
    const makeMoney = async () => {
      try {
        console.log("askdkfskd");
        const result = await allMoney();
        setMoney(result);
      } catch (error) {
        console.log(error);
      }
    };
    makeMoney();
  }, []);
  console.log(moneyList);
  return (
    <div className="Wrapper">
      <ul>

        {moneyList.map((el) => {
          return (
            <li key={el._id} className={style.header}>
              {" "}
              <div>
              <p>Название:{el.name}</p>
              <p>Дата:{el.date}</p></div>
              <p>Описание:{el.description}</p>
              <p>Важность:{el.importance}</p>
              <p>Стоимость:{el.value}</p>{" "}
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default Body;
